const l=JSON.parse('{"key":"v-43ed5492","path":"/en/train/eda/algorithm-data/Part_7_algorithm/7_4_graph/7_4_8_%E5%93%88%E5%AF%86%E9%A1%BF%E5%9B%9E%E8%B7%AF%E5%92%8C%E5%93%88%E5%AF%86%E9%A1%BF%E8%B7%AF%E5%BE%84.html","title":"7.4.8 哈密顿回路和哈密顿路径","lang":"en-US","frontmatter":{"title":"7.4.8 哈密顿回路和哈密顿路径","order":8},"headers":[{"level":3,"title":"哈密顿图","slug":"哈密顿图","link":"#哈密顿图","children":[]},{"level":3,"title":"状态压缩","slug":"状态压缩","link":"#状态压缩","children":[]},{"level":3,"title":"记忆化搜索","slug":"记忆化搜索","link":"#记忆化搜索","children":[]},{"level":3,"title":"哈密顿路径问题实例","slug":"哈密顿路径问题实例","link":"#哈密顿路径问题实例","children":[]}],"git":{"createdTime":1723131714000,"updatedTime":1723131714000,"contributors":[{"name":"Xingquan-Li","email":"fzulxq@gmail.com","commits":1}]},"readingTime":{"minutes":8.75,"words":2625},"filePathRelative":"en/train/eda/algorithm-data/Part_7_algorithm/7_4_graph/7_4_8_哈密顿回路和哈密顿路径.md","localizedDate":"August 8, 2024","excerpt":"<h1> 哈密顿回路和哈密顿路径</h1>\\n<p>内容概要：</p>\\n<ol>\\n<li>Hamilton路径、回路算法</li>\\n<li>基于位运算的状态压缩优化</li>\\n<li>记忆化搜索</li>\\n<li>Hamilton图的应用</li>\\n</ol>\\n<h3> 哈密顿图</h3>\\n<p>问题来源：1859年，爱尔兰数学家、天文学家哈密顿提出的一个在正十二面体的二十个顶点上周游世界的游戏。<br>\\n<strong>基本概念：</strong><br>\\n哈密顿路径：通过图中所有顶点一次且仅一次的路径称为哈密顿(Hamilton)路径；<br>\\n哈密顿回路：通过图中所有顶点一次且仅一次的回路称为哈密顿回路；<br>\\n哈密顿图：具有哈密顿回路的图称为哈密顿图；<br>\\n半哈密顿图：具有哈密顿路径而没有哈密顿回路的图称为半哈密顿图。</p>","copyright":{"author":"iEDA","license":"GPL-3.0"}}');export{l as data};
